import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
  Link,
  HStack,
  useColorModeValue,
  Code,
  Heading,
} from '@chakra-ui/react';

const Webapps = () => {
  return (
    <Box mt={2}>
      <ModalBody>
        <Button
          leftIcon={<FaGooglePlay />}
          colorScheme={firstColor}
          size="lg"
          mr={5}
        >
          <Link>Download Now (PlayStore)</Link>
        </Button>
        <Button
          leftIcon={<FaAppStore />}
          colorScheme={firstColor}
          size="lg"
          mr={5}
        >
          <Link>Download Now (App Store)</Link>
        </Button>
        <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
          <Link>View Source Code</Link>
        </Button>
      </ModalBody>
    </Box>
  );
};

export default Webapps;
